-- ----------------------------
-- Procedure structure for p_imp_user_info
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_imp_user_info`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `p_imp_user_info`(in v_table_name varchar(300),
																 in v_operator_id varchar(300),
																 out v_proc_result varchar(300) )
begin
	declare v_count int ;
  DECLARE v_sql varchar(4000);

  set v_proc_result = '1';
  set v_sql = '';
  set v_count = 0;

  call sp_log('p_imp_user_info', 'begin');
	call sp_log('v_table_name',v_table_name);
	call sp_log('v_operator_id', v_operator_id);
	
	set v_table_name = LOWER(v_table_name);

	#临时表增加serror
  #alter table v_table_name add serror varchar(200);
		
	set v_sql = CONCAT("alter table ",v_table_name," add (serror varchar(200)) ");   
	call sp_log('p_imp_user_info', LOWER(v_sql));
	set @sql = LOWER(v_sql);
	PREPARE stmt FROM @sql;          
  EXECUTE stmt ;                   
  deallocate prepare stmt;         

	
  #去除空格
	set v_sql = CONCAT("update ", v_table_name, "  a
												 set a.operator_id = trim(operator_id),
														 a.name   		 = trim(name),
														 a.mobile      = trim(mobile),
														 a.email       = trim(email),
