-- ----------------------------
-- Procedure structure for sp_log
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_log`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `sp_log`(in proc_name varchar(300), in remark varchar(300) )
begin
    values(nextval('t_proc_log_sid'), sysdate(), upper(proc_name), upper(remark));
  commit;
end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for currval
-- ----------------------------
DROP FUNCTION IF EXISTS `currval`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `currval`(seq_name VARCHAR(50)) RETURNS int(11)
    DETERMINISTIC
BEGIN
     DECLARE value INTEGER; 
     SET value = 0; 
     SELECT current_value INTO value 
       FROM sequence
      WHERE name = seq_name; 
     RETURN value; 
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for find_all_sonid
-- ----------------------------
DROP FUNCTION IF EXISTS `find_all_sonid`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `find_all_sonid`(moduleId INT) RETURNS varchar(4000) CHARSET latin1
BEGIN
DECLARE sid VARCHAR(4000);
DECLARE sidChd VARCHAR(4000);
 
SET sid='';
SET sidChd = CAST(moduleId AS CHAR);
 
WHILE sidChd IS NOT NULL DO
SET sid= CONCAT(sid,',',sidChd);
SELECT GROUP_CONCAT(superior_id) INTO sidChd FROM t_module WHERE FIND_IN_SET(module_id,superior_id)>0;
END WHILE;
RETURN sid;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for find_all_subsids
-- ----------------------------
DROP FUNCTION IF EXISTS `find_all_subsids`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `find_all_subsids`(moduleId INT) RETURNS varchar(1000) CHARSET latin1
BEGIN
    DECLARE sTemp VARCHAR(1000);
    DECLARE sTempPar VARCHAR(1000); 
    SET sTemp = ''; 
    SET sTempPar = moduleId; 
 
    #循环递归
    WHILE sTempPar is not null DO 
        #判断是否是第一个，不加的话第一个会为空
        IF sTemp != '' THEN
            SET sTemp = concat(sTemp,',',sTempPar);
        ELSE
            SET sTemp = sTempPar;
        END IF;
        SET sTemp = concat(sTemp,',',sTempPar); 
        SELECT group_concat(superior_id) INTO sTempPar FROM t_module where superior_id<>module_id and FIND_IN_SET(module_id,sTempPar)>0; 
    END WHILE; 
 
RETURN sTemp; 
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for fn_getModuleName
