DROP FUNCTION IF EXISTS `fn_getModuleName`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `fn_getModuleName`(v_module_id varchar(100)) RETURNS varchar(1000) CHARSET utf8
