-- ----------------------------
DROP FUNCTION IF EXISTS `fn_getorgname`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `fn_getorgname`(orgId varchar(128)) RETURNS varchar(128) CHARSET utf8
BEGIN
	DECLARE orgName varchar(128) CHARSET utf8;
	select a.ORG_NAME from t_organization a where a.org_id = orgId
	into orgName;
	return orgName;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for fn_getrolenames
-- ----------------------------
DROP FUNCTION IF EXISTS `fn_getrolenames`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `fn_getrolenames`(operator_id varchar(128)) RETURNS varchar(128) CHARSET utf8mb4
BEGIN
	DECLARE roleNames varchar(128) CHARSET utf8;
	SELECT
		group_concat(
			b.ROLE_NAME
			ORDER BY
				b.role_id SEPARATOR ','
		)
	FROM
		t_user_role a,
		t_role b
	WHERE
		a.ROLE_ID = b.ROLE_ID
	AND a.OPERATOR_ID = 159999
	GROUP BY
		b.role_id
	into roleNames;
	return roleNames;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for fn_getusername
-- ----------------------------
DROP FUNCTION IF EXISTS `fn_getusername`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `fn_getusername`(operatorId INT ) RETURNS varchar(255) CHARSET utf8mb4
BEGIN
	DECLARE name varchar(128);
	select a.name from t_user a where a.operator_id = operatorId
	into name;
	return name;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for fn_is_number
-- ----------------------------
DROP FUNCTION IF EXISTS `fn_is_number`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `fn_is_number`( strs varchar(300)) RETURNS int(11)
BEGIN
	DECLARE result int;
	
	set result = 0;

	select strs REGEXP '[^0-9.]' into result from dual;
	RETURN result;

end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for INSTR2
-- ----------------------------
DROP FUNCTION IF EXISTS `INSTR2`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `INSTR2`(v_string varchar(5000), v_delimiter varchar(20), pos int,nth int) RETURNS varchar(5000) CHARSET latin1
begin
 
declare icount int default 0;
 
declare len int default 0;
 
declare len1 int default 0;
 
declare lth int default 0;
 
declare lth1 int default 0;
 
declare str1 varchar(5000) default '';
 
 
 
set len = length(v_string);
 
set len1 = length(v_delimiter);
 
set lth = instr(v_string ,v_delimiter);
 
 
 
if lth=0 then
 
 set icount = lth;
 
else
 
 if pos is null   then
 
  set icount = lth;
 
 elseif pos < 0 then
 
  set icount = locate(v_delimiter,v_string,len+pos-1);
 
 elseif pos = 0 then
 
  set icount = 0;
 
 elseif  pos = 1 then
 
  if nth is null  then
 
   set icount = lth;
 
  elseif nth >=1 then
 
   set icount = if (length(substring_index(v_string ,v_delimiter,nth))=0 or length(substring_index(v_string,v_delimiter ,nth))=length(v_string ),0,length(substring_index(v_string ,v_delimiter,nth))+1);
 
  else
 
   set icount = 0;
 
  end if;
 
 else
 
  if (nth is null) or (nth=1) then
 
   set icount = locate(v_delimiter,v_string,pos);
 
  elseif nth > 1 then
 
   set str1 = substring(v_string,pos) ;
 
   set icount = if (length(substring_index(str1 ,v_delimiter,nth))=0 or length(substring_index(str1,v_delimiter ,nth))=length(str1),0,length(substring_index(str1 ,v_delimiter,nth)));
 
   if icount<>0 then    
 
    set icount = icount+pos;
 
   end if;
 
  end if;
 
 end if;
 
end if;
 
 return icount;
 
end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for nextval
-- ----------------------------
DROP FUNCTION IF EXISTS `nextval`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `nextval`(seq_name VARCHAR(50)) RETURNS int(11)
    DETERMINISTIC
BEGIN
     UPDATE sequence
          SET current_value = current_value + increment 
          WHERE name = seq_name; 
      RETURN currval(seq_name); 
END
;;
DELIMITER ;
